&lt;td&gt;Sau Khi Có Được Năng Lực Bá Đạo Ở Dị Giới, Tôi Cũng Vô Đối Ở Thế Giới Thực&lt;/td&gt;
&lt;td&gt;I Got a Cheat Skill in Another World and Became Unrivaled in the Real World&lt;/td&gt;
&lt;td&gt;5/13&lt;/td&gt;  
&lt;td&gt;2023&lt;/td&gt;
&lt;td&gt;2D&lt;/td&gt;
&lt;td&gt;NB&lt;/td&gt;
&lt;td style="white-space: nowrap; text-overflow:ellipsis; overflow: hidden; max-width:1px;"&gt;Yuya Tenjo là một thanh niên bị đối xử tàn nhẫn từ khi còn nhỏ, khi anh ta tuyệt vọng muốn sống thì cánh cổng đến dị giới đã mở ra cho anh ta! Ở phía bên kia của cánh cổng là Vương quốc quỷ vĩ đại nơi những con quái vật hung dữ tràn lan

Ở một thế giới khác, anh đã giải cứu công chúa khỏi tay yêu quái và trở thành chủ đề bàn tán sôi nổi của người dân trên khắp đất nước... Trong thế giới thực, nhiều cô gái bắt đầu nhiệt tình theo đuổi anh ấy...!&lt;/td&gt;  
