&lt;td style="white-space: nowrap; text-overflow:ellipsis; overflow: hidden; max-width:1px;"&gt;Nhất Thế Độc Tôn - Yi Shi Du Zun 2023 kể về câu chuyện sau khi kiếm nô Lâm Vân của Thanh Vân Tông trùng sinh, ngộ tính vốn rất kém nay lại trở nên khác người, sau một bộ Mãnh Hổ Quyền lại có thể đột phá đến võ đạo Tam Trùng cảnh có thể trở thành đệ tử ngoại môn của tông môn. Nhưng dù thoát khỏi thân phận kiếm nô trở thành đệ tử ngoại môn, Lâm Vân vẫn bị các đệ tử khác kỳ thị, tất cả đều chỉ vì một ngày làm kiếm nô, cả đời làm kiếm nô.&lt;/td&gt;  
