&lt;td style="white-space: nowrap; text-overflow:ellipsis; overflow: hidden; max-width:1px;"&gt;Mạo Nhi Sơn là một ngọn núi ở bên trong Đông Lâm sơn mạch. Ở dưới núi có một thôn làng, dân phong ở đây thuần phác, thường cày ruộng mà sống, đoạn tuyệt với thế giới bên ngoài. Một buổi sáng sớm, ở trước cổng chính của thôn trang, toàn bộ hương thân trong thôn đang đứng tiễn đưa một thiếu niên chừng mười lăm, mười sáu tuổi. Thiếu niên này trông gầy yếu nhưng trắng trẻo sạch sẽ, thoạt nhìn rất là nhu thuận. Y phục trên người hắn chỉ là một bộ thanh sam bình thường nhưng đã bị phai màu trở thành màu trắng, hai mắt toát lên vẻ lanh lợi, trong sáng. Hắn tên là Bạch Tiểu Thuần.&lt;/td&gt;  
