&lt;td&gt;Thanh Gươm Diệt Quỷ- Làng Rèn Kiếm&lt;/td&gt;
&lt;td&gt;Demon Slayer: Swordsmith Village Arc&lt;/td&gt;
&lt;td&gt;4/11&lt;/td&gt;  
&lt;td&gt;2023&lt;/td&gt;
&lt;td&gt;2D&lt;/td&gt;
&lt;td&gt;NB&lt;/td&gt;
&lt;td style="white-space: nowrap; text-overflow:ellipsis; overflow: hidden; max-width:1px;"&gt;Thanh Gươm Diệt Quỷ- Làng Rèn Kiếm: Sau trận chiến với Thượng Huyền Lục, thanh gươm của Tanjiro cũng bị hư hỏng nặng và lúc này, cậu cần một thanh gươm mới để tiếp tục lên đường làm nhiệm vụ. Cậu được đưa đến Làng Rèn Gươm, nơi phụ trách rèn vũ khí cho các kiếm sĩ của Đội Diệt Quỷ và chuẩn bị cho trận chiến mới với các thành viên mạnh nhất trong hàng Thượng Huyền của Thập Nhị Quỷ Nguyệt.&lt;/td&gt;  
&lt;/tr&gt;
