&lt;td&gt;Hoạ Giang Hồ Chi Bất Lương Nhân&lt;/td&gt;
&lt;td&gt;Hua Jiang Hu: Bu Liang Ren&lt;/td&gt;
&lt;td&gt;169/171&lt;/td&gt;  
&lt;td&gt;2014&lt;/td&gt;
&lt;td&gt;3D&lt;/td&gt;
&lt;td&gt;TQ&lt;/td&gt;
&lt;td style="white-space: nowrap; text-overflow:ellipsis; overflow: hidden; max-width:1px;"&gt;Vào cuối thời Đường, thiên hạ đại loạn, phiên trấn cát cứ, quần hùng nổi dậy. Nghe nói trước khi Phản quân Hoàng Sào đánh chiếm Trường An, một tổ chức thần bí trong Quan phủ – Bất Lương Nhân, đã từng thực thi một nhiệm vụ sau cùng, sau đó liền biến mất. Gần như cùng lúc khi bọn họ biến mất, Phản quân lục soát khắp Trường An cũng chẳng thể tìm ra được Bảo Tạng Quốc Khố. Từ đó về sau, trong giang hồ lưu truyền một lời đồn, bên trên Long Tuyền kiếm trong truyền thuyết có ẩn chứa một bí mật vô cùng to lớn.&lt;br/&gt;
Phần 1 (2014): 54 Tập ( Tập 1 -&gt; Tập 54)&lt;br/&gt;
Phần 2 (2016): 40 Tập ( Tập 55 -&gt; Tập 94)&lt;br/&gt;
Phần 3 (2018): 40 Tập ( Tập 95 -&gt; Tập 134)&lt;br/&gt;
Phần 4 (2021): 13 Tập ( Tập 135 -&gt; Tập 147)&lt;br/&gt;
Phần 5 (2022): 12 Tập ( Tập 148 -&gt; Tập 159)&lt;br/&gt;
Phần 6 (2023): 12 Tập ( Tập 160 -&gt; Tập 171)&lt;br/&gt;
&lt;/td&gt;  
&lt;/tr&gt;
